import React from "react";

import bde from "../../../media/vieetudiante/bde.jpg";

const MPU = () => {
  return (
    <div className="divMPU">
      <div className="fondMPU">
        <div className="textMC">
          <h2>La médecine préventive Universitaire</h2>
          <p>
            Le Bureau des Étudiants est là pour créer une cohésion entre les
            étudiants en organisant des soirées, des animations, vente de
            Sweat-shirt...
          </p>
          <div className="liensMC">
            <a
              className="link"
              href="https://mdc-roanne.univ-st-etienne.fr/fr/menu-3/sous-menu-3-1.html"
            >
              Pour en savoir plus
            </a>
          </div>
        </div>
      </div>
    </div>
  );
};

export default MPU;
